import React from 'react'
import {
    AppBar,
    Toolbar,
    ListItem,
    IconButton,
    ListItemText,
    Avatar,
    Divider,
    List,
    Typography,
    Box
} from "@material-ui/core";
import{
    ArrowBack,
    AssigmentInd,
    Home,
    Apps,
    ContactMail
} from "@material-ui/icons";
import silasImage from '../images/Silas.jpg'
import { makeStyles } from '@material-ui/core/styles';

// CSS styles
const useStyle = makeStyles({
    menuSilderContainer:{
        widht:250,
        background:"#511",
        height:"30rem",
    }
})


export const Navbar = () => {
    const classes = useStyle()
    return (
    <>
        <Box className={classes.menuSilderContainer} compoent = "div">
        {/* the avatart is the component for showing  a image */}
            <Avatar src = {silasImage} alt="this is the photo of Silas" />
        </Box>

        <Box component="nav">
            <AppBar position="static" style={{background:'#222'}}>
                <Toolbar>
                    <IconButton>
                        <ArrowBack style={{color:"tomato"}}/>
                    </IconButton>
                    <Typography variant='h5' style={{color:"tan"}}>
                        Porfolio
                    </Typography>
                </Toolbar>
            </AppBar>
        </Box>
    </>
    )
}

export default Navbar;
